import React from 'react';
import './App.css';
import {ItemViewer} from './ItemViewer'
import {Home} from './Home'
import {Account} from './Account'
import {TopBar} from './TopBar'


import {BrowserRouter,
		Routes,
		Route,
		Link
		} from "react-router-dom";

function App() {

	const api_url = window.location.host;

	return (
		<BrowserRouter>
		<div>

			<TopBar />



			<div class='main-cont'>
				<Routes>
					<Route path="/shop*" element={<Home search="http://localhost:8000/api/items/"/>} />

				</Routes>

			</div>


			{api_url}

		</div>
		</BrowserRouter>
	);
}

export default App;
